      'select t.*, t2.last_name || '','' || t2.first_name as user_name  
        from usr_pat_cl_item_cmnt t, utl_user t2 
        where t.pat_cl_id = :PAT_CL_ID 
        and   t.item_id = :ITEM_ID 
        and   t.user_id = t2.user_id
