              t2.item_type_id, 
              t2.item_group_id
        from  usr_pat_item t,
              usr_item t2
        where t.patient_id = :PATIENT_ID
        and   t.item_id = :ITEM_ID 
        and   t.pat_item_id = :PAT_ITEM_ID 
